// src/components/Main.js
import React from 'react';
import NetworkGraph from './NetworkGraph';
import '../styles/Main.css';

const Main = () => {
  return (
    <div className="main-panel">
      <div className="main-text">
        <h1 className="main-title">Self-Assembling Intelligence</h1>
        <p className="main-subtitle">Completely Autonomous AI Systems<br />Build the future.</p>
      </div>
      <div className="main-animation">
        <NetworkGraph />
      </div>
    </div>
  );
};

export default Main;
